import React, {useState} from 'react';

const style = {
  border: "1px solid black",
  padding: '1px',
  margin: '1px'
};

function ValueControl(props) {
  return (
    <div >
      <p>{props.name}</p>
      <p>{props.value} {props.unit}</p>
      kokos
    </div>
  );
}

export default function ChannelControl(props) {
  return (
    <div style={style}>
      Kokos {props.channel}
      <button>Active</button> <br/>
      <ValueControl name="Offset" value="123" unit="mV"/>
      Scale..<button>+</button><button>-</button>
    </div>
  )
}
